INSERT INTO `tweets` VALUES (5474, '1227342465960681475', '2.Serum \nMinimum volume required:\nChildren and adults:¬†Collect 1 tube (5-10 mL) of whole blood in a serum separator tube.\nInfant:¬†A minimum of 1 mL of whole blood is needed for testing pediatric patients. If possible, collect 1 mL in a serum separator tube.\n#CDC #coronavirus', '2020-02-11 21:23:41', 'en', 'recent', 1, 0, 'USA', '2353171615', 'Dallas, TX', 'Samreen Fathima', 'DrSamreenfatima', 2977, 1044, 1500, '2014-02-20 12:27:32');
INSERT INTO `tweets` VALUES (5475, '1227342463523835905', 'Sputum\nHave the patient rinse the mouth with water and then expectorate deep cough sputum directly into a sterile, leak-proof, screw-cap sputum collection cup or sterile dry container. Refrigerate specimen at 2-8¬∞C and ship overnight to CDC on ice pack. #CDC #coronavirus', '2020-02-11 21:23:40', 'en', 'recent', 1, 0, 'USA', '2353171615', 'Dallas, TX', 'Samreen Fathima', 'DrSamreenfatima', 2977, 1044, 1500, '2014-02-20 12:27:32');
INSERT INTO `tweets` VALUES (5476, '1227342462374612995', 'Respiratory specimens:\nA. Lower respiratory tract\n Bronchoalveolar lavage, tracheal aspirate\nCollect 2-3 mL into a sterile, leak-proof, screw-cap sputum collection cup or sterile dry container. Refrigerate specimen at 2-8¬∞C and ship overnight to CDC on ice pack.#CDC #coronavirus', '2020-02-11 21:23:40', 'en', 'recent', 1, 0, 'USA', '2353171615', 'Dallas, TX', 'Samreen Fathima', 'DrSamreenfatima', 2977, 1044, 1500, '2014-02-20 12:27:32');
INSERT INTO `tweets` VALUES (5477, '1227342460982001665', 'Specimen : For initial diagnostic testing for 2019-nCoV, CDC recommends collecting and testing upper respiratory (nasopharyngeal¬†AND¬†oropharyngeal swabs), and lower respiratory (sputum, if possible)) for those patients with productive coughs.#CDC #coronavirus', '2020-02-11 21:23:40', 'en', 'recent', 1, 0, 'USA', '2353171615', 'Dallas, TX', 'Samreen Fathima', 'DrSamreenfatima', 2977, 1044, 1500, '2014-02-20 12:27:32');
INSERT INTO `tweets` VALUES (5478, '1227342459878957057', 'What lab needs to know\n- Clinical laboratories should NOT attempt viral isolation from specimens collected from 2019-nCoV PUIs.\n-At this time, diagnostic testing for 2019-nCoV can be conducted only at CDC.#CDC #coronavirus', '2020-02-11 21:23:40', 'en', 'recent', 0, 0, 'USA', '2353171615', 'Dallas, TX', 'Samreen Fathima', 'DrSamreenfatima', 2977, 1044, 1500, '2014-02-20 12:27:32');
INSERT INTO `tweets` VALUES (5479, '1227342458335432705', 'Treatment \n-There is no specific antiviral treatment recommended for 2019-nCoV infection. \n-People infected with 2019-nCoV should receive supportive care to help relieve symptoms.\n#CDC #coronavirus', '2020-02-11 21:23:39', 'en', 'recent', 0, 0, 'USA', '2353171615', 'Dallas, TX', 'Samreen Fathima', 'DrSamreenfatima', 2977, 1044, 1500, '2014-02-20 12:27:32');
INSERT INTO `tweets` VALUES (5480, '1227342457060417536', '-Stay home when you are sick.\n-Cover your cough or sneeze with a tissue, then throw the tissue in the trash.\n-Clean and disinfect frequently touched objects and surfaces using a regular household cleaning spray or wipe.#CDC #coronavirus', '2020-02-11 21:23:39', 'en', 'recent', 0, 0, 'USA', '2353171615', 'Dallas, TX', 'Samreen Fathima', 'DrSamreenfatima', 2977, 1044, 1500, '2014-02-20 12:27:32');
INSERT INTO `tweets` VALUES (5481, '1227342439138168840', 'CDC believes at this time that symptoms of 2019-nCoV may appear in as few as 2 days or as long as 14 after exposure. This is based on what has been seen previously as the incubation period of¬†MERS¬†viruses.#CDC #coronavirus https://t.co/3ahVfbJ69z', '2020-02-11 21:23:35', 'en', 'recent', 2, 0, 'USA', '2353171615', 'Dallas, TX', 'Samreen Fathima', 'DrSamreenfatima', 2977, 1044, 1500, '2014-02-20 12:27:32');
